"""
A string is said to be a special string if either of two conditions is met:

All of the characters are the same, e.g. aaa.
All characters except the middle one are the same, e.g. aadaa.
A special substring is any substring of a string which meets one of those criteria.
Given a string, determine how many special substrings can be formed from it.
"""

def substrCount(s):
    string_augment = []
    current_character = s[0]
    current_count = 1
    for letter in s[1:]:
        if letter == current_character:
            current_count += 1
        else:
            string_augment.append((current_character, current_count))
            current_character = letter
            current_count = 1
    string_augment.append((current_character, current_count))
    print(string_augment)

    count = sum(x[1] * (x[1] + 1) // 2 for x in string_augment)
    for index in range(2, len(string_augment)):
        if string_augment[index - 2][0] == string_augment[index][0] and string_augment[index - 1][1] == 1:
            count += min(string_augment[index - 2][1], string_augment[index][1])

    return count

print(substrCount("aaabcc"))

test_string = ""

print(substrCount(test_string))